import React, { useState } from 'react';
import axios from 'axios';
import Layout from '../components/Layout';
import { Menu } from 'lucide-react';

const TokenCreation = () => {
  const [form, setForm] = useState({
    name: '',
    description: '',
    amount: '',
    type: 'Mintable',
    decimals: 0,
  });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm({ ...form, [name]: value });
  };

  const handleSlider = (e) => {
    setForm({ ...form, decimals: parseInt(e.target.value) });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');

    try {
      const res = await axios.post(
        'https://profitpilot-backend.onrender.com/api/token',
        { name: form.name },
        {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`,
          },
        }
      );

      setSuccess('Token created successfully!');
    } catch (err) {
      setError(err.response?.data?.msg || 'Error creating token');
    }
  };

  return (
    <Layout>
      <div className="bg-black text-white min-h-screen p-5">
        <div className="flex items-center justify-between mb-5">
          <h2 className="text-2xl font-bold text-orange-500 flex items-center gap-2">
            <Menu size={24} className="cursor-pointer md:hidden" />
            My Tokens
          </h2>
        </div>

        <form
          onSubmit={handleSubmit}
          className="bg-[#111] p-5 rounded-xl max-w-xl mx-auto shadow-md"
        >
          <div className="mb-4">
            <label className="block mb-1 text-orange-400">Token Name</label>
            <input
              type="text"
              name="name"
              value={form.name}
              onChange={handleChange}
              className="w-full p-2 rounded bg-black text-white border border-orange-500"
              required
            />
          </div>

          <div className="mb-4">
            <label className="block mb-1 text-orange-400">Description</label>
            <textarea
              name="description"
              value={form.description}
              onChange={handleChange}
              className="w-full p-2 rounded bg-black text-white border border-orange-500"
              maxLength={160}
            />
          </div>

          <div className="mb-4">
            <label className="block mb-1 text-orange-400">Amount of Issued Tokens</label>
            <input
              type="number"
              name="amount"
              value={form.amount}
              onChange={handleChange}
              className="w-full p-2 rounded bg-black text-white border border-orange-500"
            />
          </div>

          <div className="mb-4">
            <label className="block mb-1 text-orange-400">Token Type</label>
            <select
              name="type"
              value={form.type}
              onChange={handleChange}
              className="w-full p-2 rounded bg-black text-white border border-orange-500"
            >
              <option value="Mintable">Mintable</option>
              <option value="Burnable">Burnable</option>
            </select>
          </div>

          <div className="mb-4">
            <label className="block mb-1 text-orange-400">Decimals: {form.decimals}</label>
            <input
              type="range"
              name="decimals"
              min="0"
              max="18"
              value={form.decimals}
              onChange={handleSlider}
              className="w-full"
            />
          </div>

          <button
            type="submit"
            className="w-full py-2 bg-orange-600 hover:bg-orange-700 rounded text-white font-bold mt-4"
          >
            Create Token
          </button>

          {error && <p className="text-red-500 mt-3">{error}</p>}
          {success && <p className="text-green-500 mt-3">{success}</p>}
        </form>
      </div>
    </Layout>
  );
};

export default TokenCreation;
